import React, { useState } from "react";
import Icon from "react-native-vector-icons/AntDesign";
import Icon2 from "react-native-vector-icons/Feather"
import Icon4 from "react-native-vector-icons/MaterialCommunityIcons" 
import { launchCamera, launchImageLibrary } from "react-native-image-picker";
import { SafeAreaView, View, Text, ScrollView, StyleSheet, TouchableOpacity, TextInput, Image } from "react-native";
import {  
   First,
   BackupTxt,
   Second,
   
} from "../componenets/fintech11Style"
import { BigText5 } from "../componenets/fintech6Style";
import { Quantity1, PhotoView1, QtyText1 } from "../componenets/fintech5Style";
import { PhotoView, Quantity, QtyText, CaretWhitespace } from "../componenets/fintech4Style";

export default function History({navigation, route}){
    const [routee, setRoute]= useState(route.params.paramKey);
    return(
        <SafeAreaView style={styles.pendingContainer}>
            <ScrollView>
                <First>
                    <TouchableOpacity onPress={()=>navigation.goBack()}>
                        <Icon style={styles.pad}size={30} color="#C3AD60" name="back"/>
                    </TouchableOpacity>
                    <BigText5 style={styles.padd}>History</BigText5>
                    <TouchableOpacity>
                    <Icon4 size={20} color="#C3AD60" name="calendar"/>
                    </TouchableOpacity>
                </First>
                <Second>
                <PhotoView1 source={require('../../../../assets/pro-modified.png')}style={{justifyContent:'space-between'}}>
                    <Quantity1><QtyText1>Qty: 1</QtyText1><Icon name="caretdown" size={6} color="#fff"/></Quantity1>
                    <View style={styles.linkView}>
                    <Text 
                    style={styles.link}
                    >
                        {routee}
                    </Text>
                    </View>
                   
                </PhotoView1>
            

                <PhotoView source={require('../../../../assets/shoe-modified.png')}>
                    <Quantity><QtyText>Qty: 1</QtyText><CaretWhitespace><Icon name="caretdown" size={12} color="#fff"/></CaretWhitespace></Quantity>
                </PhotoView>
                </Second>
            </ScrollView>
            <TouchableOpacity  style={styles.backup}>
                <BackupTxt>Back Up</BackupTxt>
            </TouchableOpacity>
        </SafeAreaView>
)}

const styles= StyleSheet.create({
    pendingContainer: {
        backgroundColor: "#000",
        flex: 1,
        paddingTop: 25,
    },
    defaultText: {
        color: "#fff",
        textAlign: "center"
    },
    pad: {
        paddingLeft: 30,
    },

    padd: {
        paddingLeft: 90,
        paddingRight: 100
    },
    backup: {
        height: 48,
        width: 300,
        borderColor: "#C3AD60",
        borderWidth: 2,
        backgroundColor: "#000",
        position: "absolute",
        top: 550,
        left: 25,
        alignItems: "center",
        justifyContent: "center",
        borderRadius: 100
    },
    linkView: {
        height: 54,
        width: 320,
        backgroundColor: "#4E4E4E",
        borderBottomLeftRadius: 13,
        borderBottomRightRadius: 13,
        paddingLeft: 25,
        justifyContent:"space-between",
        marginTop: 105,
        flexDirection: "row",
        alignItems: "center",
        paddingRight: 25,
    },
    link:{
        color:"#fff",
    },
})
